import React from 'react';

export const NewPaymentButton = () => {

    state = {
        showModal: false
    }

    showModal = () => {
        this.setState({ showModal: true });
    }

    hideModal = () => {
        this.setState({ showModal: false });
    }

    return (
        <button onClick={this.showModal}>
            Ingresar Pago
        </button>
    );
}
